import AuthProvider from "./context/auth";
import './App.css';
import Navbar from './components/Navbar/Navbar';
import LandingPage from "./pages/LandingPage/LandingPage";
import { Routes, Route } from "react-router-dom";

function App() {
  const dark = true;
  return (
    <AuthProvider>
      <div className="App">
        <Navbar dark={ dark }/>
        <LandingPage dark={dark}/>
      </div>
    </AuthProvider>
  );
} 

export default App;
